import React from "react";
import "./styles.css";

import Navbar from "./components/Navbar";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

// PAGES
import Home from "#";
import Products from "#";
import Reports from "#";

export default function App() {
  return (
    <div className="App">
      <Router>
        <Navbar />
        <Switch>
          <Route path="/"  />
          <Route path="/products" />
          <Route path="/reports"/>
        </Switch>
      </Router>
    </div>
  );
}
